import React from 'react';

const SearchArticle = ({ results }) => {
  if (!results.length) {
    return <div>Không tìm thấy bài báo nào.</div>;
  }

  return (
    <div>
      <h2>Kết quả tìm kiếm</h2>
      <ul>
        {results.map((article, index) => (
          <li key={index}>
            <a href={`/article?url=${encodeURIComponent(article.link)}`} target="_blank" rel="noopener noreferrer">
              {article.title}
            </a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default SearchArticle;
